package _0_999._300_399;

// 392. Is Subsequence
public class _392_IsSubsequence {
    public boolean isSubsequence(String s, String t) {
        if (t.isBlank() && !s.isBlank()) {
            return false;
        }

        char[] letters = new char[t.length()];
        int index = 0;
        for (int i = 0; i < t.length(); i++) {
            letters[i] = t.charAt(i);
        }

        for (int i = 0; i < s.length(); i++) {
            if (index == letters.length) {
                return false;
            } else {
                for (int j = index; j < letters.length; j++) {
                    if (letters[j] == s.charAt(i)) {
                        index = j + 1;
                        break;
                    } else if (j == letters.length - 1) {
                        return false;
                    }
                }
            }
        }
        return true;
    }

    public void solution() {
        System.out.println(isSubsequence("axc", "ahbgdc"));
        System.out.println(isSubsequence("ab", "baab"));

        System.out.println(isSubsequence("abc", "ahbgdc"));
        System.out.println(isSubsequence("leeeeetcode", ""));
    }

}
